    [],nt"num_tags": 7,nt"name": "audubon-national-wildlife-refuge-annual-narrative-report-calendar-year-1995",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Audubon
    National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    The report includes a planning section which discusses management planning, public
    participation, compliance with environmental mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, croplands, grasslands,
    other habitats, grazing, haying, fire management, and pest control. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh and water birds, shorebirds, raptors, other migratory birds, game
    mammals, other resident wildlife, fishery resources, wildlife propagation and stocking,
    scientific collections, animal control, and marking and banding. The public uses
    of the Refuge described in this report include outdoor classrooms,  information
    and interpretation, hunting, fishing, trapping, wildlife observation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment utilization and replacement,
    communication systems, and energy conservation. Cooperative programs are discussed,
    as well. Narrative reports for Audubon Wetland Management District, Lake Nettie,
    McLean, Lost Lake, Lake Otis, Sheyenne Lake, Camp Lake, and Strawberry Lake National
    Wildlife Refuges and are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
